import React from "react";
import { Document, Page } from "react-pdf";

import resume from "../../assets/SarahKerr.pdf";

function Resume() {
  return (
    <Document file={resume}>
      <Page pageNumber={1} />
    </Document>
  );
}
export default Resume;
